function handleStateChange(event) {
  var poppedLang = event.state.lang;
  if (poppedLang != lang) {
    //Language change - no book change
    lang = poppedLang;
    if (lang == "he") {
      switchToHebrew();
    } else if (lang == "en") {
      switchToEnglish();
    }
    rebuildScreen();
    changePageTitle(event.state.title);
    return;
  }
  changePageTitle(event.state.title);
}

